import React from "react";

function Box(props) {
    const clickMe = ()=>{
        alert("내꿈은 프론트앤드 개발자")
    }
  return (
  <h1 className="box">
    리액트 연습{props.num}
    {props.name}
    <button onClick={clickMe}>클릭!</button>
    </h1>
  )
}

export default Box;
